A partir de hoje, MTV e Samsung Galaxy A convidam fãs para participarem do desafio #MIAWABSURDO. Para participar, basta criar uma coreografia com a letra A, usando o Absurda Remix criado pelo DJ Pedro Sampaio para essa ação. Os 20 escolhidos irão integrar a plateia virtual do MTV MIAW. E o melhor vídeo ganha também um smartphone Galaxy A71. A terceira edição do evento acontece no dia 24 de setembro, às 22h (horário de Brasília), com entradas ao vivo para TV, pela primeira vez. Bruna Marquezine e Manu Gavassi serão as apresentadoras. 

Mecânica da promoção #MIAWABSURDO

Para participar da promoção, basta criar uma coreografia com a letra A, ao som do Absurda Remix do DJ Pedro Sampaio. O vídeo precisa ser postado no TikTok ou no Reels do Instagram com a hashtag #MIAWABSURDO. As estrelas das 20 coreografias selecionadas irão fazer parte da plateia virtual do MTV MIAW. E o melhor vídeo ganha um Galaxy A71, com tripé, ringlight.

Importante: Os perfis participantes precisam estar "públicos" para que possam ser considerados. E é necessário que o dono do perfil apareça no vídeo. Não vale colocar outra pessoa pra fazer o job. Os candidatos podem postar quantos vídeos quiserem.

O concurso já está no ar e vai até às 23h59min do dia 16 de setembro de 2020.

